import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';
import { Injectable, Inject } from '@angular/core';

@Injectable({
  providedIn: 'root',
})

export class ExampleDataService {

  constructor(private httpClient: HttpClient, @Inject('BASE_URL') private baseApiUrl: string) { }

  getExamples(): Observable<Example[]> {
    console.log("getExamples")
    return this.httpClient.get<Example[]>('http://localhost:5256/ExampleApi/getexamplelist');
  }

  importJson(file: any, fileName: string) {
    console.log("importJson")
    const formData = new FormData();

    formData.append("file", file, fileName);

    return this.httpClient.post('http://localhost:5256/ExampleApi/importjson', formData).pipe(map(data => { })).subscribe(result => {
      console.log(result);
    });
  }
}

export interface ExampleModel {
  Id: number;
  DepartmentName: string;
  Notes: string;
  EnvironmentScore: number;
  HealthScore: number;
  SafetyScore: number;
  JsonData: string;
}
